import web3 from "./web3";
import Blockhub from "./build/Projhub.json";

const instance = new web3.eth.Contract(
    JSON.parse(Blockhub.interface),
    "0x3f39BE2b7B1edb8d02Dc59e4A4648b8bFD4FC33D"
);

export default instance;
